{
  "extends": [
    "config:base",
    "monorepo:angular"
  ],
  "ignoreDeps": [
    "semantic-release",
    "@semantic-release/git",
    "@semantic-release/changelog"
  ],
  "ignorePaths": ["**/docs-src/**"],
  "pinVersions": false,
  "separatePatchReleases": false,
  "ignoreUnstable": true,
  "automerge": true,
  "automergeType": "branch-push",
  "lockFileMaintenance": {
    "enabled": true
  },
  "peerDependencies": {
    "versionStrategy": "widen"
  },
  "packageRules": [
    {
      "sourceUrlPrefixes": [
        "https://github.com/babel/babel"
      ],
      "groupName": "babel monorepo"
    },
    {
      "packageNames": [
        "chai",
        "chai-spies"
      ],
      "groupName": "chai"
    },
    {
      "packagePatterns": ["^karma"],
      "groupName": "karma"
    },
    {
      "packagePatterns": ["^eslint"],
      "groupName": "eslint"
    },
    {
      "packagePatterns": ["^rollup"],
      "groupName": "rollup"
    },
    {
      "packagePatterns": ["lerna"],
      "groupName": "lerna"
    },
    {
      "packagePatterns": ["jest"],
      "groupName": "jest"
    },
    {
      "packageNames": [
        "@vue/test-utils",
        "vue",
        "vue-template-compiler"
      ],
      "groupName": "vue"
    },
    {
      "packageNames": [
        "react",
        "react-test-renderer",
        "@types/react",
        "@testing-library/react-hooks"
      ],
      "groupName": "react"
    },
    {
      "packagePatterns": ["^aurelia-"],
      "groupName": "aurelia"
    }
  ]
}

